import React from "react";
// import iFrameResize from 'iframe-resizer'

// INTERNAL IMPORTS
import Resource from "../Resource";

// CHILD COMPONENT IMPORTS
import Resume from "../UploadPhotosToWeb/docs/Resume_Liz_Kane.pdf"
import LizLogo from "../UploadPhotosToWeb/docs/seekLogo@4x.png"
import LizPortrait from "../UploadPhotosToWeb/docs/LizKanePortrait.png"
// import  from ""


const ResumeDoc = () => {
    const resourceArray = [
        {name: "Curriculum Vitae", print: "Resume / CV", iframe: Resume, document: "./UploadPhotosToWeb/docs/Liz_Kane_Resume.pdf", src:"file:///Users/lizkane/Desktop/GA/SEI/Projects/2ReactPortfolio/portfolio-app-2/src/components/ResourcesProjects/UploadPhotosToWeb/docs/Liz_Kane_Resume.pdf", description1:"Full Stack", description2:"Software Engineer", emblem: LizPortrait, logo: LizLogo, category: "Resume"},
    ]

    const resourceItem = resourceArray.map(resource => {return <Resource key={resource.name} name={resource.name} print={resource.print} description1={resource.description1} description2={resource.description2} description3={resource.description3} iframe={resource.iframe} emblem={resource.emblem} logo={resource.logo} category={resource.category}/>
    })



    return(
        <div style={{overflow: "hidden"}}>
            {resourceItem}
        </div>
    )
}

export default ResumeDoc;
